import React from "react";

export const Radiobtn = () => {
  const { type } = props;
  return (
    <div>
      <FastField>
        {() => (
          <>
            <input type='radio' name='year' id="year"/>
            <label htmlFor=""></label>
          </>
        )}
      </FastField>
    </div>
  );
};
